!(function () {
  var e, n;

  // Hàm lấy giá trị từ cookie
  function getCookie(name) {
    var nameEQ = name + "=";
    var ca = document.cookie.split(';');
    for (var i = 0; i < ca.length; i++) {
      var c = ca[i];
      while (c.charAt(0) == ' ') c = c.substring(1, c.length);
      if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length, c.length);
    }
    return null;
  }

  // Kiểm tra xem ChatbotConfig có tồn tại hay không
  window.ChatbotConfig
    ? ((e = window.ChatbotConfig),
      // Lấy session_id và user_id từ cookie
      (sessionId = getCookie("session_id")),
      (userId = getCookie("user_id")),
      
      // Tạo iframe, sessionId và userId sẽ không được truyền vào URL
      (n = document.createElement("iframe")),
      (n.src = e.baseUrl),  // Không truyền session_id và user_id vào URL
      (n.style.width = "100%"),
      (n.style.height = "600px"),
      (n.style.border = "none"),
      document.addEventListener("DOMContentLoaded", function () {
        document.body.appendChild(n);
      }))
    : console.error("ChatbotConfig không được định nghĩa");
})();
